INSERT INTO `news` (`id`, `name`, `title`, `active`, `description`, `date_publication`, `abstract`, `language`, `user_id`, `order`) VALUES
(14, 'News', '1. PRUEBA', 1, 'DASCOM’s LED Lighting business is at the forefront of lighting the world of tomorrow. With our Sonaray™ brand of LED lighting solutions, our mission is to provide the absolute best in energy efficient lighting. With a broad array of research, development, test and production capabilities and facilities, our experienced team is dedicated to producing only the highest quality LED lights.\n', '2014-09-05', '', 'en', 0, 1),
(15, 'Categoria prueba', '2. ESTA ES UNA NOTICIA DE EJEMPLO PARA VISUALIZAR EN EL MODULO', 1, 'DASCOM’s LED Lighting business is at the forefront of lighting the world of tomorrow. With our Sonaray™ brand of LED lighting solutions, our mission is to provide the absolute best in energy efficient lighting. With a broad array of research, development, test and production capabilities and facilities, our experienced team is dedicated to producing only the highest quality LED lights.\n', '2014-09-06', '1411423200', 'en', 0, 2),
(48, 'Categoria prueba', '6 . Esta es una prueba (webmaster)', 1, 'DASCOM’s LED Lighting business is at the forefront of lighting the world of tomorrow. With our Sonaray™ brand of LED lighting solutions, our mission is to provide the absolute best in energy efficient lighting. With a broad array of research, development, test and production capabilities and facilities, our experienced team is dedicated to producing only the highest quality LED lights.\n', '2014-11-20', '', 'en', 0, 3),
(53, 'Categoria prueba update2', 'prueba', 1, 'DASCOM’s LED Lighting business is at the forefront of lighting the world of tomorrow. With our Sonaray™ brand of LED lighting solutions, our mission is to provide the absolute best in energy efficient lighting. With a broad array of research, development, test and production capabilities and facilities, our experienced team is dedicated to producing only the highest quality LED lights.\n', '2014-11-25', '', 'en', 0, 4),
