(55, 'News', 'Dascom Europe GmbH', 1, 'Dascom Europe GmbH \r\nFinden Sie auf der Eltefa Stuttgart in  Halle 7  auf  Stand E47.', '2015-03-10', '', 'du', 0, 7);
