INSERT INTO `products_applications_texts` (`id`, `name`, `description`, `active`, `application_type_id`, `language`) VALUES
(1, 'descripcion', 'SonarayÂ´s LED MR16s are designed and constructed with LED chips from Citizen Electronics Co., Ltd., a highly respected Japan-headquartered company with a worldwide reputation for precision processes, instrumentation, engineering and product development.  This provides the best in quality, excellence and advanced technology for Sonaray lamps and luminaires. <br /><br />\nThis product can be used as a direct replacement for  traditional MR16s. Offering low heat dissipation, energy savings and long life, it is suitable for installation in residential settings, office buildings, hotels, shops and other places where direct lighting is required.', 1, 1, 'en'),
(2, 'descripcion', 'otro', 1, 2, 'en');
