(19, 'Description', 'High Quality CITIZEN LED Chipset<br />\n40,000 Hours of Lifetime with 70% Lumen Maintenance<br />\nNo Flicker; Easy Replacing Halogen Lamps<br />\nNo UV/IR and Less Heat Emission<br />\n88% Energy Saving Compared to Halogen Lamps\n', 1, 3, 'en', 7),
(20, 'Descripción', 'Chipset LED CITIZEN de Alta Calidad<br />\nVida útil de 40.000 Horas con Mantenimiento de Lumen del 70%<br />\nLibre de Parpadeo (flicker); Sustitución Simple de Lámparas Halógenas<br />\nLibre de UV/IR y Menor Emisión de Calor<br />\nAhorro de Energía de 88% Comparado con Lámparas Halógenas\n', 1, 3, 'es', 7),
(21, 'Descripción', 'Chipset LEDs CITIZEN de Alta Qualidade<br />\nVida Útil de 40.000 Horas com Manutenção de Lúmen de 70%<br />\nLivre de Cintilação (flicker); Substituição Simples das Lâmpadas Halógenas<br />\nLivre de UV/ IR e Menos Emissão de Calor<br />\nEconomia de 88% em Comparação com Lâmpadas Halógenas\n', 1, 3, 'po', 7),
(22, 'specification', 'Power 4W<br />\nLuminous Flux 156lm<br />\nLuminous Efficacy 39lm/W<br />\nColor Temp 2700K (Options 3000K/4000K/6300K)<br />\nBeam Angle 25°/ 36°<br />\nDimmable No<br />\nMaterial Aluminum + Plastic<br />\nHousing Color Silver Gray<br />\nSafety Standards CE <br />\nOperating Temp -20°~ +40°<br />\nPower Supply AC12V<br />\nWeight 51.3g<br />\nAverage Lifetime 40000hrs, L70<br />\nA (mm) 50<br />\nB (mm) 47<br />\nIlluminance Area Dia. (D1) / Max. Lx 1m/309Lx<br />\nIlluminance Area Dia. (D2) / Max. Lx 2m/77Lx  <br />', 1, 3, 'en', 4),
