(33, 'Especificaciones', 'Potência 6W<br />\nFluxo Luminoso 245lm<br />\nEficácia Luminosa 41lm/W<br />\nTemperatura de Cor 2700K (Options 3000K/4000K/6300K)<br />\nÂngulo do Feixe Luminoso 25°/ 36°<br />\nDimerização Não<br />\nMaterial Alumínio + Plástico<br />\nCor do Encapsulamento Cinza<br />\nPadrões de Segurança CE <br />\nTemperatura de Operação -20°~ +40°<br />\nFonte de Alimentação 12VAC<br />\nPeso 51.3g<br />\nVida Útil Média 40000hrs, L70<br />\nA (mm) 50<br />\nB (mm) 47<br />\nDiâmetro da Área Luminosa (D1) / Max. Lx  1m/453Lx<br />\nDiâmetro da Área Luminosa (D2) / Max. Lx  2m/113Lx  <br />', 1, 4, 'po', 4),
(34, 'Applications', 'Hotels<br />\nBars<br />\nCosmetics Counters<br />\nRestaurants<br />\nWashrooms<br />\nReception Areas<br />\nCorridors<br />\nHalls<br />\n', 1, 4, 'en', 6),
(35, 'Aplicaciones', 'Hoteles<br />\nBares<br />\nStand de Cosméticos<br />\nRestaurants<br />\nBaños<br />\nAréas de Recepción<br />\nCorredores<br />\nPasillos\n', 1, 4, 'es', 6),
(36, 'Aplicaciones', 'Hotéis<br />\nBares<br />\nBalcões de Cosméticos<br />\nRestaurantes<br />\nLavanderias<br />\nÁreas de recepção<br />\nCorredores<br />\nSalões<br />\n', 1, 4, 'po', 6),
(192, 'Description', 'DL-1032 High Quality CITILED LED Chipset<br />\nExcellent Color Rendering<br />\n35,000 Hours of Lifetime with 70% Lumen Maintenance<br />\nChromaticity Specifications in Accordance with ANSI Standard C78.377<br />\nSingle LED Chipset Design<br />\nSeveral Cover Options Available, Creating either Soft or Spot Lighting<br />\nInstant-On without Flickering<br />\nMultiple Choices of the Power, Size, Beam Angle and Lamp Housing Color<br />\nDimmable to 20%\n', 1, 22, 'en', 7),
(193, 'Descripcion', 'DL-1032 Chipset LED CITILED de Alta Calidad<br />\nExcelente Reproducción de Color<br />\nVida Útil de 35.000 Horas con Mantenimiento de Lumen del 70%<br />\nEspecificaciones de Cromaticidad en Conformidad con el Estándar ANSI C78.377<br />\nDiseño con un Único Chipset LED<br />\nDisponibles Diversos Tipos de Cubiertas, Creando Iluminación Suave o Direccional<br />\nEncendido Instantáneo, Libre de Parpadeo (flicker)<br />\nMúltiples Opciones de Potencia, Tamaño, Ángulo de Luz y Color de Carcasa<br />\nDimerizable hasta un 20%\n', 1, 22, 'es', 7),
(194, 'Descripcion', 'DL-1032 Chipset LEDs CITILED de Alta Qualidade<br />\nExcelente Renderização de Cor<br />\nVida Útil de 35.000 Horas, com Manutenção de Lúmen de 70%<br />\nEspecificação de Cromaticidade em Conformidade com o Padrão ANSI C78.377<br />\nDesign com um Único Chipset LED<br />\nDisponibilidade de Diversos Tipos de Tampa, Criando Iluminação Suave ou Direcional (Spot)<br />\nAcendimento Instantâneo, Livre de Cintilação (flicker)<br />\nMúltiplas Opções de Alimentação, Tamanho, Angulação do Feixe Luminoso e Cor do Encapsulamento<br />\nDimerizável até 20%\n', 1, 22, 'po', 7),
