(8403, 'Description', ' \r\n                             \r\n                            <p>DL-1020 High Quality CITILED LED Chipset<br />Excellent Color Rendering<br />35,000 Hours of Lifetime with 70% Lumen Maintenance<br />Chromaticity Specifications in Accordance with ANSI Standard C78.377<br />Single LED Chipset Design<br />Several Cover Options Available, Creating either Soft or Spot Lighting<br />Instant-On without Flickering<br />Multiple Choices of the Power, Size, Beam Angle and Lamp Housing Color<br />Dimmable to 20%</p>                                                                                                    ', 1, 21, 'en', 7),
(8404, 'Specifications', ' \r\n                             \r\n                            <p>DL-1020 Power: 20W<br />Luminous Flux: 1200lm~1300lm<br />Luminous Efficacy: 60lm/w~65lm/w<br />Beam Angle:40° / 80°<br />Color Temp: 3000K/4000K<br />CRI: ≥80<br />Dimmer Range: 20~100%<br />Material: Aluminum<br />Housing Color: White<br />Safety Standards: CE<br />Operating Temp: -20°C ~ +40°C<br />Power Supply: External<br />Weight: 550g<br />Average Lifetime: More than 35,000 hours<br />A (mm): 140 ( 4”)<br />B (mm): 90<br />C (mm): 120<br />Illuminance Area Dia. (D1) / Max. Lx: 0.8m/1520~1550Lx<br />Illuminance Area Dia. (D2) / Max. Lx: 1.6m/380~385Lx<br />Illuminance Area Dia. (D3) / Max. Lx: 2.4m/170~175Lx<br />Illuminance Area Dia. (D4) / Max. Lx: 3.3m/95~98Lx</p>                                                                                                    ', 1, 21, 'en', 4),
