(8406, 'Descripcion', ' \r\n                             \r\n                            <p>DL-1020 Chipset LED CITILED de Alta Calidad<br />Excelente Reproducción de Color<br />Vida Útil de 35.000 Horas con Mantenimiento de Lumen del 70%<br />Especificaciones de Cromaticidad en Conformidad con el Estándar ANSI C78.377<br />Diseño con un Único Chipset LED<br />Disponibles Diversos Tipos de Cubiertas, Creando Iluminación Suave o Direccional<br />Encendido Instantáneo, Libre de Parpadeo (flicker)<br />Múltiples Opciones de Potencia, Tamaño, Ángulo de Luz y Color de Carcasa<br />Dimerizable hasta un 20%</p>                                                                                                    ', 1, 21, 'es', 7),
