(8409, 'Description', ' \r\n                             \r\n                             \r\n                            DL-1020 Chipset LEDs CITILED de Alta Qualidade<br />\r\nExcelente Renderização de Cor<br />\r\nVida Útil de 35.000 Horas, com Manutenção de Lúmen de 70%<br />\r\nEspecificação de Cromaticidade em Conformidade com o Padrão ANSI C78.377<br />\r\nDesign com um Único Chipset LED<br />\r\nDisponibilidade de Diversos Tipos de Tampa, Criando Iluminação Suave ou Direcional (Spot)<br />\r\nAcendimento Instantâneo, Livre de Cintilação (flicker)<br />\r\nMúltiplas Opções de Alimentação, Tamanho, Angulação do Feixe Luminoso e Cor do Encapsulamento<br />\r\nDimerizável até 20%\r\n                                                                                                                                                    ', 1, 21, 'po', 7),
