INSERT INTO `products_texts` (`id`, `name`, `text`, `visible`, `product`, `language`, `category`) VALUES
(12001, 'Description', ' \r\n                             \r\n                            <p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--></p><p>Die Optima Highbay verfügt über einen dimmbaren Bereich von 20 - 100%  (0-10V) dabei hat das Netzteil einen konstanten Wirkungsgrad über gesamten Dimm Bereich. <strong> </strong></p><p>Das spezielle Design der Kühlkörper sorgt für eine effiziente Wärmeabfuhr und verbessert somit die Lebensdauer der Lampe.</p><p>Das Netzteil verfügt über  Kurzschluss- Überlast- und Überspannungsschutz der Thermische Schutz der Leuchte wir durch Mikroprozessor kontrollierte Temperaturregelung realisiert.</p><p>„<strong>No Inrush</strong>“  Dieses Feature erlaubt Ihnen dass auf einer Phase in der Gebäude-/ Lichttechnik, z.B. NYM Kabel 1,5mm² einen absoluten Standard Leistungsschutzschalter TYP B16  mit so vielen Stromquellen belasten können, bis Sie die max. dauerhafte Leistung von ca.3.500W auf dieser Phase erreicht haben! Deshalb bezeichnen wir die Technik als „No inrush“. Genau genommen haben wir einen so geringen Inrush / Startstrom beim Einschalten, dass bis zur kompletten Leistungsgrenze von 3.500W dies für den Installateur keine Rolle spielt.</p><p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>DE</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>