INSERT INTO `products_types_texts` (`id`, `name`, `description`, `active`, `product_type`, `language`) VALUES
(16, 'descripcion', 'Sonaray´s LED MR16s are designed and constructed with LED chips from Citizen Electronics Co., Ltd., a highly respected Japan-headquartered company with a worldwide reputation for precision processes, instrumentation, engineering and product development.  This provides the best in quality, excellence and advanced technology for Sonaray lamps and luminaires. <br /><br />\r\nThis product can be used as a direct replacement for  traditional MR16s. Offering low heat dissipation, energy savings and long life, it is suitable for installation in residential settings, office buildings, hotels, shops and other places where direct lighting is required.                                    ', 1, 4, 'en'),
(17, 'descripcion', 'Los MR16s LED Sonaray son diseñados y construidos con chips LED de Citizen Electronics Co., Ltd., una compañía muy respetada con sede en Japón,  con una reputación mundial por sus procesos de precisión, instrumentación, ingeniería y desarrollo de productos. Esto asegura la mejor calidad, excelencia y avanzada tecnología para las lámparas y luminarias Sonaray. <br /><br />\r\n\r\nEste producto se puede utilizar directamente para remplazar MR16s tradicionales, ofreciendo baja emisión de calor, ahorro de energía y larga vida útil, es adecuado para su instalación en edificios de oficinas, residenciales, hoteles, tiendas y otros lugares donde se requiere una iluminación directa.             ', 1, 4, 'es'),
(18, 'descripcion', 'Os MR16s LED Sonaray são projetado e construído com chips LED da Citizen Citizen Electronics Co., Ltd., uma companhia sediada no Japão com reputação de alcance mundial em processos de precisão , instrumentação, engenharia e desenvolvimento de produtos. Este fato garante o melhor em qualidade, excelência e tecnologia avançada para lâmpadas e luminárias Sonaray. <br /><br /> Este produto pode ser utilizado como substituto direto dos produtos MR16 tradicionais. Oferece baixa emissão de calor, economia de energia e vida útil longa, é apropriado para instalações domésticas, para prédios comerciais, hotéis, lojas e outros lugares onde iluminação direta é requerida.                                    ', 1, 4, 'po'),
(19, 'descripcion', 'TubesWith energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\r\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\r\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\r\n            ', 1, 5, 'en'),
(20, 'descripcion', 'Los Tubos LED Sonaray son diseñados con una carcasa de aleación de aluminio de disipación eficiente, utilizando chips LED de Citizen® de alta calidad y una estructura de alimentación externa individual. Logran un ahorro de energía de hasta un 60% más que los tradicionales tubos fluorescentes\r\n\r\n                                                                                                                        ', 1, 5, 'es'),
(21, 'descripcion', 'TubosOs LEDs tubulares Sonaray são projetados com uma eficiente couraça em liga de alumínio, usam os chipsets LEDs Citizen de altíssima qualidade e estrutura de alimentação externa independente. Alcançam economia de energia de até 60% comparados aos tubos fluorescentes.\r\n\r\n<br /><br />  Com super-alto índice de luminosidade, altos índices de renderização de cor, e vida útil prolongada com até 35.000 horas, baseado no padrão de testes IESNA LM-80. Possuem um design tipo abajur com 240°, o que possibilita uma distribuição uniforme da luz sem a ocorrência de áreas de sombra.                                                                                                                         ', 1, 5, 'po'),
(22, 'descripcion', 'Down LightsSONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\r\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\r\n            ', 1, 1, 'en'),
(23, 'descripcion', 'Los downlights Sonaray son especialmente diseñado con una sola fuente de luz LED que reduce la fatiga visual y el cansancio,  eliminando la formación de  sombras múltiples o efectos de imágenes fantasmas. Con el uso de  chips LED de Citizen® para garantizar la calidad, la excelencia y  avanzada tecnología, los downlights SONARAY poseen el grado más alto de seguridad de las  normas internacionales  seguridad fotobiológicas y radiación  establecidos para la piel  y  ojos humanos.                                                                                    ', 1, 1, 'es'),
(24, 'descripcion', 'Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chipsets LEDs da Citizen para garantir qualidade, excelência e tecnologia avançada, os donwlights Sonaray alcançam os mais altos graus de segurança dos padrões internacionais de radiação e segurança fotobiológica estabelecidos para a pele e olhos humanos.Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chipsets LEDs da Citizen para garantir qualidade, excelência e tecnologia avançada, os donwlights Sonaray alcançam os mais altos graus de segurança dos padrões internacionais de radiação e segurança fotobiológica estabelecidos para a pele e olhos humanos.            Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chipsets LEDs da Citizen para garantir qualidade, excelência e tecnologia avançada, os donwlights Sonaray alcançam os mais altos graus de segurança dos padrões internacionais de radiação e segurança fotobiológica estabelecidos para a pele e olhos humanos.            Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chipsets LEDs da Citizen para garantir qualidade, excelência e tecnologia avançada, os donwlights Sonaray alcançam os mais altos graus de segurança dos padrões internacionais de radiação e segurança fotobiológica estabelecidos para a pele e olhos humanos.            Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chi