(25, 'descripcion', 'High BayWith distinct housing styles, wide power selection, high quality chip sets for outstanding lumen output, and a long life of 50,000 hours, SONARAY High Bay LED luminaires provide the discriminating user with the best in energy savings, brightness, and light distribution choices.<br/>\r\nPerfect in a variety of settings including warehouses, production facilities, processing plants, and more (especially in high ceiling areas), SONARAY LED High Bays are designed to provide users with an exceptional return on investment through energy bill reduction, reduced maintenance costs, and excellent environmental lighting for maximum productivity.\r\n                       ', 1, 2, 'en'),
(26, 'descripcion', 'Los  high bay Sonaray son especialmente diseñados con una sola fuente de luz LED de este modo se reduce la fatiga visual y el cansancio, eliminando la formación de  sombras múltiples o efectos de imágenes fantasmas.  DASCOM usa un diseño de pantalla que permite una iluminación suave y uniformidad de brillo, proporcionando una iluminación confortable de espacios y tener una eficacia de la luz excelente.\r\n            ', 1, 2, 'es'),
(27, 'descripcion', 'Especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Os produtos High Bays com design em formato de abajur permitem uma iluminação suave e brilho uniforme, fornecendo uma iluminação confortável de espaços propiciando excelente eficiência luminosa.        Especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Os produtos High Bays com design em formato de abajur permitem uma iluminação suave e brilho uniforme, fornecendo uma iluminação confortável de espaços propiciando excelente eficiência luminosa.             ', 1, 2, 'po'),
(28, 'descripcion', 'SONARAY street lights are designed for the pulse of a world on the move.  With high power LED chip sets, an ergonomic design, and secondary integrated optics, SONARAY street lights provide the best in energy savings, combined with a high color rendering for crisp, clear light.  A unique, patented exterior design includes horizontal vents on the back of the light, helping to enhance heat dissipation while reducing the accumulation of dust and other debris.  Also with anti-corrosive, anti-UV properties, they are resilient to long-term outdoor exposure.  Safe, reliable, durable, and long-lasting, SONARAY street lights are well equipped to light highways, commercial roadways, streets, parking lots and other public areas. ', 1, 3, 'en'),
(29, 'descripcion', 'El alumbrado público Sonaray de DASCOM es un producto nuevo, con gran ahorro de energía, de alto rendimiento de color, que no sólo utiliza LEDs de alta potencia de Citizen como fuente de luz, sino que también integra lentes secundarios. Su diseño exterior ha sido patentado. La parte posterior de la lámpara está equipada con orificios de ventilación horizontales únicas, que no sólo permite a la lámpara tener una excelente capacidad de disipación de calor, sino que también reducen la acumulación de polvo. Seguro, fiable, eficaz y de larga duración, es adecuado para áreas que requieren altos niveles de iluminación, tales como carreteras, vías de circulación en los centros comerciales y otros espacios públicos.                                     ', 1, 3, 'es'),
(30, 'descripcion', 'Street Light iluminação pública Sonaray de DASCOM são produtos novos, econômicos, com alto índices de renderização de cor, que usa LEDs Citizen de alta potência como fonte de luz. Mas não é só isso,  também está integrado à lentes que funcionam como fonte luminosa secudária. O design exterior é patenteado. A parte posterior da lâmpada é equipada com aberturas de ventilação horizontais, que não apenas dão  excelente capacidade de dissipação de calor, mas também reduzem o acúmulo de poeira. Segura, confiável, durável, eficiente energeticamente e com vida útil prolongada, ela é ideal para áreas com exigência de altos níveis de iluminação, tais como vias principais, ruas em centros comerciais e outras áreas públicas.                                   ', 1, 3, 'po'),
(34, 'descripcion', 'With energy savings of up to 60%, and a rated lifetime of more than 35,000 hours, SONARAY LED tubes not only give you crisp, clear light, but save you money now, and well into the future.<br/>\nDesigned with an aluminum alloy shell and high quality LED chip sets, our tubes provide ultra-high brightness and color-rendering with exceptional heat dissipation capability.<br/>\nEach SONARAY LED tube also comes with a 240 degree lampshade design so you are assured of uniform light distribution with no dark areas.\n', 1, 5, 'en'),
(37, 'descripcion', 'SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\n', 1, 1, 'en'),
(39, 'descripcion', 'Os downlights Sonaray são especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Utilizam chipsets LEDs da Citizen para garantir qualidade, excelência e tecnologia avançada, os donwlights Sonaray alcançam os mais altos graus de segurança dos padrões internacionais de radiação e segurança fotobiológica estabelecidos para a pele e olhos humanos.', 1, 1, 'po'),
(42, 'descripcion', 'Especialmente desenhados com uma fonte de luz única para  reduzir a fadiga e sobrecarga dos olhos, eliminando sombras múltiplas e efeitos fantasmas. Os produtos High Bays com design em formato de abajur permitem uma iluminação suave e brilho uniforme, fornecendo uma iluminação confortável de espaços propiciando excelente eficiência luminosa. ', 1, 2, 'po'),
(46, 'descripcion', 'SONARAY flood lights are the perfect lighting solution for open spaces or in areas where a large amount of light with even distribution is required. A choice of available wattages and beam angles provides flexibility so users can find the best light for their specific application. Smartly engineered for high efficacy and rugged design, SONARAY flood lights provide durability, energy savings, and exceptional lumen output to maximize light distribution while helping you save money on energy costs. ', 1, 7, 'en'),
(47, 'descripcion', 'The best solution for indirect and decorative lighting, the Sonaray LED Light Strip can be placed in small places achieving impressive and pleasant lighting effects. A variety in tones of white, power and sizes allow this product to fit in almost every architectural design, and also be implemented in a wide range of applications where large amount of light is required with reduced installation space.', 1, 8, 'en'),
(48, 'descripcion', 'La mejor solución para iluminación indirecta y decorativa, los Lights Strip de Sonaray pueden ubicarse en espacios muy reducidos logrando efectos de iluminación impresionantes y agradables. Variedad en tonos de blanco, potencias y tamaños permiten ajustarse a prácticamente cualquier  diseño arquitectónico, y también ser implementados en un amplio rango de aplicaciones donde  se requiera gran cantidad de luz con un espacio de instalación reducido.', 1, 8, 'es'),
(49, 'descripcion', 'Las luminarias Flood Light de SONARAY son la solución perfecta para espacios abiertos o para áreas donde se requiere una gran cantidad de luz distribuida uniformemente. Su disponibilidad en diferentes opciones de potencia y ángulos de haz proporciona flexibilidad a estos productos por lo que el usuario podrá encontrar modelo más adecuado para su aplicación. Con un diseño robusto y de alta eficacia, los Flood Light de SONARAY ofrecen durabilidad, ahorro energético y un flujo luminoso excepcional que maximiza la distribución de luz mientras que ayuda a ahorrar dinero en costo energético y mantenimiento.', 1, 7, 'es'),
(50, 'descripcion', 'Spot                                                                                                ', 1, 1, 'ch'),
(51, 'descripcion', 'Sonaray''s LED Light Strip are designed and constructed with LED Chips from Citizen Electronics Co. Ltd., a highly respected Japan-headquartered company with a worldwide reputation. This products are used on internal environments such as airports, commercial building, store and home spaces.', 1, 8, 'en'),
(52, 'descripcion', 'Flexible, affordable, reliable and efficient - that describes the SONARAY LED Matrix Light Bar.  Designed for optimal efficiency, our unique bracketing mechanism allows you to configure our light bar luminaire to contain from one to five light bars.  The mechanism can be adjusted and angled so you have excellent light distribution in just the right places.  Each bar offers a lightweight but durable aluminum body and provides exceptional lumen output since our construction includes only top-of-the-line, high quality chip sets.<br/>\r\nSONARAY light bars are the perfect choice in industrial, heavy commercial, or even residential applications.  \r\n                                                                                                        ', 1, 11, 'en'),
(53, 'descripcion', 'Los productos Sonaray LED Light Strip están diseñados y construidos con chips LED de Citizen Electronics Co. Ltd., una compañía con sede en Japón que cuenta con una respetada reputación en todo el mundo. Estos productos se utilizan en ambientes internos, tales como aeropuertos, edificios comerciales, tiendas y espacios de su casa.', 1, 8, 'es'),
(54, 'descripcion', 'La nueva generación de luminarias LED SONARAY. Las Barras de Luz Matrix son un producto con alto \r\n\r\ndesempeño y una gran flexibilidad de instalación lo que permite su aplicación desde ambientes \r\n\r\nindustriales hasta iluminación decorativa.\r\n\r\nCon un cuerpo rígido de aluminio cuenta con una excelente disipación y evita a su vez el uso de \r\n\r\nluminarias o componentes adicionales para su uso. Instalación simple y rápida.\r\n\r\nLarga vida útil, alta emisión de luz y una gran variedad de formas de instalación.                                                                                                         ', 1, 11, 'es'),
(55, 'Flood Light', 'Flood Light', 1, 7, 'en'),
(58, 'descripcion', 'High lighting power for all environments. Sonaray presents the LED Flood Light as the perfect lighting solution in open spaces or where is required a big amount of light with even distribution. Available in different powers of illumination and beam angles that allows to choose the most suitable product for each application. BrightScape series is the result of a smart engineering interested in high efficacy and visual comfort. Low glare, high efficacy and light power          Flood Light            Flood Light            Flood Light            Flood Light            Flood Light            ', 1, 7, 'po'),
(59, 'descripcion', 'Flood Light', 1, 7, 'po'),
(60, 'descripcion', 'The new generation of SONARAY LED luminaires. The Matrix Light Bar are products with high performance and a variety of installation methods that allows its use both in industrial such as decorative applications. With a rigid aluminum body, counts with an excellent heat dissipation and at the same time avoids the use of light fixtures or additional components for its use. Quick and simple installing. Long lifetime, high lumen output and a variety of installation methods.                                                                            ', 1, 11, 'ch'),
(61, 'descripcion', 'The new generation of SONARAY LED luminaires. The Matrix Light Bar are products with high performance and a variety of installation methods that allows its use both in industrial such as decorative applications. With a rigid aluminum body, counts with an excellent heat dissipation and at the same time avoids the use of light fixtures or additional components for its use. Quick and simple installing. Long lifetime, high lumen output and a variety of installation methods.                                                                                     ', 1, 11, 'po'),
(62, 'descripcion', 'The best solution for indirect and decorative lighting, the Sonaray LED Light Strip can be placed in small places achieving impressive and pleasant lighting effects. A variety in tones of white, power and sizes allow this product to fit in almost every architectural design, and also be implemented in a wide range of applications where large amount of light is required with reduced installation space.', 1, 8, 'po'),
(63, 'descripcion', 'High lighting power for all environments. Sonaray presents the LED Flood Light as the perfect lighting solution in open spaces or where is required a big amount of light with even distribution. Available in different powers of illumination and beam angles that allows to choose the most suitable product for each application. BrightScape series is the result of a smart engineering interested in high efficacy and visual comfort. Low glare, high efficacy and light power.                                                                ', 1, 7, 'ch'),
(64, 'descripcion', 'The best solution for indirect and decorative lighting, the Sonaray LED Light Strip can be placed in small places achieving impressive and pleasant lighting effects. A variety in tones of white, power and sizes allow this product to fit in almost every architectural design, and also be implemented in a wide range of applications where large amount of light is required with reduced installation space.        ', 1, 8, 'ch'),
