(68, 'descripcion', '            ', 1, 12, 'po'),
(69, 'descripcion', 'Sonaray´s LED MR16s are designed and constructed with LED chips from Citizen Electronics Co., Ltd., a highly respected Japan-headquartered company with a worldwide reputation for precision processes, instrumentation, engineering and product development.  This provides the best in quality, excellence and advanced technology for Sonaray lamps and luminaires. <br /><br />\r\nThis product can be used as a direct replacement for  traditional MR16s. Offering low heat dissipation, energy savings and long life, it is suitable for installation in residential settings, office buildings, hotels, shops and other places where direct lighting is required.                                    ', 1, 4, 'du'),
(70, 'descripcion', 'Lecko E Classic\r\nVon der Industriequalität inspiriert, durch die maximale Wirtschaftlichkeit angetrieben, entstand eine LED-Röhre für den Kostenbewussten Anwender, die in Sachen Preis-Leistung nicht zu toppen ist.\r\nDank des Abstrahlwinkels von 160° ersetzt die Lecko E Classic Röhre spielend alle herkömmlichen Leuchtstoffröhren in Raumhöhen bis 2,5m. \r\nLecko E Premium\r\nUnsere Premium Modelle meistern viele Professionelle Anwendungen, sie überzeugen durch exzellente Leistungsdaten. Maximale Helligkeit, höchste Farbwiedergabe und drehbare Endkappen zur Ausrichtung des Abstrahlwinkels. \r\nDank des hohen Lumen-Outputs bei geringem Energieverbrauch ist die Sonaray Premium Modelle die wirtschaftlichste Lichtlösung für Installationen bis 8m Raumhöhe.\r\n                                    ', 1, 5, 'du'),
(71, 'descripcion', 'Wir haben Ihr Interesse an den Sonaray Downlight´s geweckt?\r\n Kontaktieren Sie uns unter: \r\nDASCOM EUROPE GmbH \r\nHeuweg 3\r\n 89079 Ulm \r\nTel: +49 (0)731 2075 - 0 \r\nFax: +49 (0)731 2075 - 100 \r\nE-Mail Sonaray@dascom.com', 1, 1, 'du'),
(72, 'descripcion', 'High Bays sind geeignet für große überdachte Räume und Hallen. Anwendungsbeispiele sind Messegelände,Bahnhöfe, Lagerhallen etc. \r\nFür hohe überdachte Räume ab zehn Meter sind Leistungsstärkere High Bays ab 100W geeignet.\r\nDamit sind LED High Bays ideal z.B. für die Beleuchtung etwa eines Hochregallagers oder von hohen Fertigungshallen. ', 1, 2, 'du'),
(73, 'descripcion', 'SONARAY street lights are designed for the pulse of a world on the move.  With high power LED chip sets, an ergonomic design, and secondary integrated optics, SONARAY street lights provide the best in energy savings, combined with a high color rendering for crisp, clear light.  A unique, patented exterior design includes horizontal vents on the back of the light, helping to enhance heat dissipation while reducing the accumulation of dust and other debris.  Also with anti-corrosive, anti-UV properties, they are resilient to long-term outdoor exposure.  Safe, reliable, durable, and long-lasting, SONARAY street lights are well equipped to light highways, commercial roadways, streets, parking lots and other public areas. ', 1, 3, 'du'),
(74, 'descripcion', '', 0, 5, 'du'),
(75, 'descripcion', 'SONARAY downlights are designed with simplicity and functionality in mind.  With a gentle but ample light provided, you receive exceptional lighting quality and distribution.  Our downlights come with options of power and size, providing the light and visual comfort you need to do what you do.<br/>\nWith a life of 40,000 hours, these lights not only give you safe, long-lasting light, but help curb your energy and maintenance costs.\n', 1, 1, 'du'),
(76, 'descripcion', 'Delta Fluter die robuste Modellreihe für den Outdoor-Bereich Sonaray hat mit den Delta Modellen eine Baureihe entwickelt, die durch eine große Variationsbreite hinsichtlich der Lichtleistung besticht.\r\nDelta Modelle bieten alle Vorzüge des Fluter Brightscape in einem Leistungsspektrum von 30 Watt bis 520 Watt.\r\nDurch die verschiedenen Leistungsstufen der Modellfamilie können diese Fluter entsprechend den individuellen Lichtbedürfnissen\r\ndas jeweils passende Modell zur Verfügung stellen.\r\nAlle Modelle der Fluter Delta Reihe überzeugen durch ein robustes Gehäuse und wurden ebenfalls mit der Schutzklasse\r\nIP 65 zertifiziert. Sie sind staubdicht und gegen Strahlwasser geschützt..    Flood Light            Flood Light            ', 1, 7, 'du'),
(77, 'descripcion', 'The best solution for indirect and decorative lighting, the Sonaray LED Light Strip can be placed in small places achieving impressive and pleasant lighting effects. A variety in tones of white, power and sizes allow this product to fit in almost every architectural design, and also be implemented in a wide range of applications where large amount of light is required with reduced installation space.', 1, 8, 'du'),
(78, 'descripcion', 'Sonaray''s LED Light Strip are designed and constructed with LED Chips from Citizen Electronics Co. Ltd., a highly respected Japan-headquartered company with a worldwide reputation. This products are used on internal environments such as airports, commercial building, store and home spaces.', 1, 8, 'du'),
(79, 'descripcion', 'Flexibel, bezahlbar, verlässlich und effizient - Das ist die Eigenschaften der Sonary Lightbar. Unsere einzigartigen Halter erlauben es  Ihnen flexibel von einer bis zu fünf Lightbars zu installieren. Durch die flexiblen Mehrfachhalter mit verstellbaren Abstrahlwinkel haben Sie das Licht immer an der richtigen Stelle. Die Sonary Lightbar ist somit die richtige alternative zu Ihrer konventionellen Beleuchtung.\r\n                                                                                                        ', 1, 11, 'du'),
(80, 'Flood Light', 'Flood Light', 1, 7, 'du'),
(81, 'descripcion', 'Description', 1, 12, 'du'),
(82, 'descripcion', '            chinese                                    ', 1, 13, 'ch'),
(83, 'descripcion', '            Deutsch                                    ', 1, 13, 'du'),
