INSERT INTO `texts` (`id`, `section`, `name`, `text`, `path`, `active`, `parent`, `language`, `category`) VALUES
(1, 'home', 'Descarga', '<p>Descargas</p>', '/Downloads/index', 1, 0, 'es', 12),
(2, 'home', 'Producto Destacado', 'Producto Destacado', '/home/index', 1, 0, 'es', 13),
(3, 'home', 'Case Studies', 'Case Studies', '/casestudies/index', 1, 0, 'en', 11),
(4, 'home', 'Downloads', 'Downloads', '/Downloads/index', 1, 0, 'en', 12),
