(7, 'home', 'Downloads', 'Downloads', 'downloads/index', 1, 0, 'po', 12),
(8, 'home', 'Produto em Destaque', 'Produto em Destaque', '/home/index', 1, 0, 'po', 13),
(9, 'home', '案例研究', '案例研究', '/casestudies/index', 1, 0, 'ch', 11),
