(11, 'home', '特色產品', '特色產品', '/Downloads/index', 1, 0, 'ch', 13),
(12, 'aboutUs', 'About Us 1', '得实的LED照明事业是站在未来照明世界的最前列。我们的使命是通过Sonaray™LED照明解决方案为用户提供最佳的高效节能照明。通过一系列的研究、开发、测试和生产能力和设施,我们经验丰富的团队正致力于生产最佳品质的LED灯具。我们的重大技术投资意义在于通过始终如一的高品质产品为客户节约成本。这些产品不仅减少电力的使用,节省一笔实实在在的财务费用,而且致力于通过减少灯具更换频率来为我们的地球节省至关重要的自然资源。这同样又减少了碳排放和浪费。而且,不像其他的一些传统灯具,如荧光灯照明,它发射紫外线以及含汞等污染物，因此，灯具是安全的和真正环保的。\n</p>\n当然,我们的灯具具有最好的色度和清晰度，这意味着世界上成千上万的工业及办公环境可以从一个全新的视角被我们所看到。', 'null', 1, 0, 'ch', 17),
(13, 'aboutUs', 'About us 2', '实诺锐一定是选择最好的的材料来开发产品，其中包括由西铁城LED芯片。 这意味着我们的产品集成了市场上在亮度和清晰度方面最顶尖的元素。 我们与世界一流的工商业照明设计师和经验丰富的工程师来完成对产品的高标准要求。', 'null', 1, 0, 'ch', 17),
(14, 'aboutUs', 'About Us 3', '我们使用一流的生产设备，按照最严格的质量控制机测试程序来生产实诺锐照明产品，使我们的客户无论是第一次还是每次购买都能够得到最好的产品。\n<br />\n得实市场实诺锐的美洲总部设在维吉尼亚州的韦恩斯伯勒，其代表办事处在迈阿密和里约热内卢——其亚太区总部设在新加坡,其公司总部在香港。<br />\n当您选择得实的实诺锐产品，这是一个聪明的选择，他将照亮你现在和未来的梦想。<br />', 'null', 1, 0, 'ch', 17),
(15, 'aboutUs', 'About Us ', '<p>DASCOM&rsquo;s LED Lighting business is at the forefront of lighting the world of tomorrow. With our Sonaray&trade; brand of LED lighting solutions, our mission is to provide the absolute best in energy efficient lighting. With a broad array of research, development, test and production capabilities and facilities, our experienced team is dedicated to producing only the highest quality LED lights. Our significant technology investment means cost-savings for our customers through consistent high quality products. These products not only lessen electricity usage, providing tangible financial savings, but they also work to preserve vital natural resources for our world since they require reduced relamping frequency. This, in turn, reduces carbon footprint and waste. And, unlike other more traditional means of lighting such as fluorescent lights, there is no UV or mercury content so the lighting is safer and truly eco-friendly.</p><p>&nbsp;</p><p>Of course, our lighting also provides the best in chromaticity and clarity. This means literally thousands of industrial and office environments around the globe can see and be seen in a whole new light.</p>', 'null', 1, 0, 'en', 17),
(16, 'aboutUs', 'About us 2', 'Sonaray™ is developed using only the best materials, including chip sets produced by Citizen®. This means our products contain the most superior elements for brightness and clarity in the market. We couple this formula with our specialized expertise from world-class engineers who have years of experience in industrial and commercial lighting design and development. ', 'null', 1, 0, 'en', 17),
(17, 'aboutUs', 'About Us 3', 'We manufacture our Sonaray™ lighting in a top-notch production facility with stringent quality controls and test procedures so our customers get the best product the first time and every time.<br /><br />\n\nDASCOM markets Sonaray™ from its Americas headquarters based in Waynesboro, Virginia – with representative offices in Miami and Rio de Janeiro – its Asia Pacific headquarters in Singapore, and its corporate headquarters in Hong Kong.<br /><br />\n\nWhen you choose Sonaray™ from DASCOM, it’s a smart choice designed to light your dreams now and well into the future.<br /><br />', 'null', 1, 0, 'en', 17),
(18, 'aboutUs', '¿Quiénes somos?', ' Los productos de iluminación LED de DASCOM están a la vanguardia del mundo del mañana. Con nuestra marca Sonaray™, nuestra misión es proporcionar absolutamente lo mejor en iluminación LED de bajo consumo. Con amplias capacidades e instalaciones para la investigación, desarrollo, pruebas y producción, nuestro experimentado equipo se dedica a producir iluminación LED de la más alta calidad. Nuestra significativa inversión en tecnología se traduce en ahorro de costos para nuestros clientes a través productos de muy alta calidad, los cuales no sólo reducen el consumo de electricidad, proporcionando ahorros financieros tangibles, sino que también ayudan a preservar los recursos naturales vitales para nuestro mundo, debido a una menor frecuencia de reemplazo. Esto, a su vez, reduce la huella de carbono y la generación de residuos. Y, a diferencia de otros medios más tradicionales de iluminación, como luces fluorescentes, no hay emisión UV o contenido de mercurio por lo que es una tecnología más segura y verdaderamente ecológica. \n</ p> \nPor supuesto, nuestra iluminación también ofrece lo mejor de la cromaticidad y claridad. Esto significa, literalmente, que miles de entornos industriales y de oficinas en todo el mundo puede ver y ser vistos con una luz completamente nueva.\n', 'null', 1, 0, 'es', 17),
(19, 'aboutUs', 'Quienes somos2', 'Sonaray™ se desarrolla utilizando sólo los mejores materiales, incluyendo conjuntos de chips producidos por Citizen®. Esto significa que nuestros productos contienen los elementos de mayor calidad del mercado para garantizar un brillo y claridad superiores. A esta fórmula agregamos los conocimientos especializados de nuestros ingenieros de clase mundial que tienen años de experiencia en el diseño y desarrollo de la iluminación industrial y comercial.', 'null', 1, 0, 'es', 17),
(20, 'aboutUs', 'Quienes somos3', 'Fabricamos nuestros productos de   iluminación Sonaray™ en instalaciones de producción de primera clase  con estrictos controles de calidad y procedimientos de prueba para que nuestros clientes obtengan el mejor producto desde la primera vez y todas las veces.<br /><br />\n\nDascom comercializa Sonaray™ desde su sede en América localizada en Waynesboro, Virginia – con oficinas de representación en Miami y Río de Janeiro – su sede de Asia Pacífico en Singapur, y su sede central en Hong Kong.<br /><br />\n\nCuando usted elige Sonaray™ de DASCOM, es una opción inteligente diseñado para iluminar sus sueños ahora y en el futuro.', 'null', 1, 0, 'es', 17),
(21, 'aboutUs', 'Quem somos 1', 'A Iluminação LED da DASCOM posiciona-se na linha de frente quando o assunto é iluminar o mundo de amanhã. Através da Sonaray™ nossa marca para soluções de iluminação LED, a nossa missão é fornecer o grau mais elevado em eficiência energética de iluminação. Contando com amplos recursos em termos de capacitação, instalações de pesquisa e desenvolvimento, testes e produção, nossa experiente equipe é dedicada a produzir somente lâmpadas LED da mais alta qualidade. Nosso significativo investimento em tecnologia resulta em redução de custos para os nossos clientes através de produtos de alta qualidade e consistência. Estes produtos não só diminuem o uso de energia elétrica, proporcionando economia financeira tangível, mas também contribuem na preservação dos recursos naturais vitais para o nosso mundo, uma vez que reduzem a frequência de troca de lâmpadas, proporcionando menor emissão de carbono e resíduos na atmosfera. E, ao contrário de outros meios mais tradicionais de iluminação, como lâmpadas fluorescentes, não emitem raios UV nem contém mercúrio, configurando-se em um produto mais seguro e verdadeiramente sustentável. Naturalmente, a nossa iluminação também oferece o melhor em cromaticidade e nitidez. Como resultado, literalmente milhares de ambientes industriais e comerciais em todo o mundo usufruem de um sistema de iluminação mais eficiente.', 'null', 1, 0, 'po', 17),
(22, 'aboutUs', 'Quem somos 2', 'Sonaray™ é produzida com o uso exclusivo dos melhores materiais, incluindo os chipsets LEDs fabricados pela Citizen®. Isto significa que os nossos produtos contém os elementos de maior qualidade do mercado para garantir iluminação e nitidez superiores. Nós associamos esta fórmula à especialidade dos nossos engenheiros de classe global, com os seus anos de experiência no desenvolvimento e design de sistemas de iluminação industrial e comercial.', 'null', 1, 0, 'po', 17),
(23, 'aboutUs', 'Quem somos 3', '<p>Fabricamos nossos produtos de ilumina&ccedil;&atilde;o Sonaray&trade; em uma uni&atilde;o de produ&ccedil;&atilde;o de alto padr&atilde;o, com rigorosos controles de qualidade e procedimentos de testes. Desse modo, fornecemos os melhores produtos, garantindo a satisfa&ccedil;&atilde;o dos nossos clientes desde sua primeira aquisi&ccedil;&atilde;o.</p><p>A DASCOM comercializa os seus produtos da marca Sonaray&trade; nas Am&eacute;ricas a partir da sua sede em Waynesboro, Virginia e a partir de suas filiais em Miami eS&atilde;o Paulo. Na regi&atilde;o &Aacute;sia-Pac&iacute;fico os comercializa a partir das suas sedes em Cingapura e Hong Kong.</p><p>Quando voc&ecirc; escolhe Sonaray&trade; da DASCOM voc&ecirc; faz uma escolha inteligente, de uma marca projetada para iluminar seus sonhos, agora e no futuro.</p>', 'null', 1, 0, 'po', 17),
(24, 'why Sonaray', 'Advantage', 'Intensive Color Rendering', 'nulo', 1, 1, 'en', 18),
(25, 'why Sonaray', 'DT1 Rep Crom H2', 'Intensive Color Rendering (CRI)  Ra80 ', 'nulo', 1, 1, 'en', 19),
(26, 'why Sonaray', 'DT1 Rep Crom', '<p>The color rendering index (CRI) (sometimes called <em>color rendition index</em>,) is a quantitative measure of the ability of a light source to reproduce the colors of various objects precisely in comparison with an ideal or natural light source.  DASCOM uses LEDs with the highest level of top color rendering, yielding a genuine color range between 80 and 95% of CRI.  This compares favorably with most LED products on the market, including well-known brands, that generally achieve only a CRI rating of around 70%.  The resulting effect when using DASCOM LED lighting is that you will experience more clarity, better color appearance and natural visual appeal, both consciously and subconsciously.<br />\n         </p>', 'nulo', 1, 1, 'en', 20),
(27, 'why Sonaray', 'DT1 Rep Crom', 'Chromaticity Range', 'nulo', 1, 2, 'en', 18),
(28, 'why Sonaray', 'DT2 H2 Ran Crm', 'Chromaticity Range 3-Step MacAdam Ellipse', 'nulo', 1, 2, 'en', 19),
(29, 'why Sonaray', 'DT2 Text Ran Cro', '<p>ANSI C78.377 is an official standard for chromaticity specified by American National Standards Institute. Sonaray products'' range complies with ANSI C78.377 and some products correspond to “3-steps MacAdam ellipses,” which are the chromaticity ranges narrowed to about a ninth of that of the standard above.  \n        </p>', 'nulo', 1, 2, 'en', 20),
(30, 'why Sonaray', 'DT3 Estandar', 'IESNA  LM-80 Standard', 'nulo', 1, 3, 'en', 18),
(31, 'why Sonaray', 'DT3 H2 Estandar', 'IESNA  LM-80 Standard', 'nulo', 1, 3, 'en', 19),
(32, 'why Sonaray', 'DT3 Texto1', '<p>With an unmatched reputation for product quality, DASCOM differentiates itself from many of those in the LED market by making sure that all of the LED chipsets used on DASCOM lighting products comply with the IES LM-80 standard, an official quality standard from the Illuminating Engineering Society of North America (IESNA). The LM-80 is a common test to measure the lumen maintenance of LED light sources - through a usage of 6,000 hours broken down into intervals of not less than 1,000 hours, at different junction temperatures - to give the projection of lumen maintenance after usage of 35,000 hours.  </p><br/>\r\n<p>Lumen maintenance is a measure of how well a light source maintains its lumen output over time, typically shown as a percentage of initial light output. Typical LED lumen maintenance is over 70% for 35,000+ hours – a marked improvement over traditional light sources. </p>', 'nulo', 1, 3, 'en', 20),
(34, 'why Sonaray', 'DT4 Norma seg', 'Safety Standard', 'nulo', 1, 4, 'en', 18),
(35, 'why Sonaray', 'dt4 tITULO', 'Lighting Goods Bio Safety Standard EN62471:2008', 'nulo', 1, 4, 'en', 19),
(36, 'why Sonaray', 'Dt4 texto', '<p>Light sources emit certain levels of heat and radiation that can be harmful to human skin and eyes. Official standards have been made to classify the safety levels and grading of different light sources. DASCOM uses the best quality LED light sources, which are classified as Grade 4 - the highest safety standard for lighting sources, which certifies them as safe and not harmful to humans.   <br />\n        </p>', 'nulo', 1, 4, 'en', 20),
(37, 'why Sonaray', 'Ventajas', 'Reproducción Cromática', 'nulo', 1, 1, 'es', 18),
(38, 'why Sonaray', 'DT1 Rep Crom H2', 'Reproducción Cromática Intensiva (IRC) RA80 ', 'nulo', 1, 1, 'es', 19),
(39, 'why Sonaray', 'DT1 Rep Crom ', '<p>El índice de reproducción cromática (IRC) (a veces llamado <em>índice de reproducción del color</em>) es una medida cuantitativa de la capacidad de una fuente de luz para reproducir los colores de varios objetos fielmente en comparación con una fuente de luz ideal o natural. DASCOM utiliza LEDs con el más alto nivel de reproducción de color, produciendo una gama de colores genuinos con valores  CRI entre el 80 y el 95%. Esto se puede comparar favorablemente con la mayoría de los productos LED en el mercado, incluyendo marcas conocidas, que generalmente solo logran un CRI de alrededor del 70%. El efecto resultante de utilizar iluminación LED de DASCOM son ambientes de más claridad, mejor color,  aspecto natural y atractivo visual.<br />\n         </p>', 'nulo', 1, 1, 'es', 20),
(40, 'why Sonaray', 'DT2 Ran Crom', 'Rango  Cromático', 'nulo', 1, 2, 'es', 18),
(41, 'why Sonaray', 'DT2 H2 Ran Crm', 'Rango  Cromático según método de Elipse de  MacAdam de 3-pasos', 'nulo', 1, 2, 'es', 19),
(42, 'why Sonaray', 'DT2 Text Ran Cro ', ' <p>El ANSI C78.377 es un estándar para la cromaticidad especificado por American National Standards Institute. La gama de cromaticidad de los productos Sonaray cumple con la norma ANSI C78.377 y algunos productos corresponden a "elipses MacAdam  de 3-pasos", que corresponde al rango de cromaticidad reducido a alrededor de un noveno de la citada norma.   </p>', 'nulo', 1, 2, 'es', 20),
(43, 'why Sonaray', 'DT3 Estandar', 'Estándar IESNA LM-80', 'nulo', 1, 3, 'es', 18),
(44, 'why Sonaray', 'DT3 H2 Estandar', 'Estándar IESNA LM-80', 'nulo', 1, 3, 'es', 19),
(45, 'why Sonaray', 'DT3  Texto 1 ', '<p>Con una reputación inigualable en productos de alta calidad, DASCOM se diferencia de muchos otros en el mercado del LED porque garantiza que todos los conjuntos de chips LED que se utilizan en productos de iluminación cumplen con el estándar IES LM-80, una norma de calidad oficial de la Sociedad de Ingeniería de Iluminación de América del Norte (IESNA). El LM-80 es una prueba común para medir el mantenimiento del flujo luminoso de las fuentes de luz LED - a través de un uso de 6.000 horas dividido en intervalos de no menos de 1.000 horas, a temperaturas de unión diferentes - para dar a la proyección de mantenimiento del flujo luminoso después de uso 35.000 horas.</p><br/>\r\n<p>El mantenimiento del flujo luminoso es una medida de lo bien que una fuente de luz conserva su salida de en lumen con el tiempo, por lo general se muestra como un porcentaje de salida de luz inicial.  Una medida típica para el mantenimiento de lumen en LEDs es superior al 70% para mas de 35.000 horas - una mejora con respecto a las fuentes tradicionales de luz. </p>', 'nulo', 1, 3, 'es', 20),
(47, 'why Sonaray', 'DT4  Norma seg ', 'Norma de Seguridad', 'nulo', 1, 4, 'es', 18),
(48, 'why Sonaray', 'DT4  H2 Seguridad ', 'Norma de Seguridad  Biológica para Productos de Iluminación EN62471: 2008', 'nulo', 1, 4, 'es', 19),
(49, 'why Sonaray', 'DT4 Texto seg ', '<p>Las fuentes de luz emiten cierto nivel de calor y la radiación que puede ser dañina para la piel y los ojos humanos. Normas oficiales se han hecho para clasificar el nivel de seguridad  de las diferentes fuentes de luz. DASCOM usa las fuentes de luz LED de mejor calidad que se clasifican como grado 4 - el estándar de seguridad más alto para fuentes de iluminación, lo que certifica que son seguras y no perjudiciales para la salud humana. <br />\n        </p>', 'nulo', 1, 4, 'es', 20),
(50, 'why Sonaray', 'DT1 Rep Crom', 'Índice de Renderização de Cor ', 'nulo', 1, 1, 'po', 18),
(51, 'why Sonaray', 'DT1 Rep Crom H2', 'Índice de Renderização de Cor (CRI)', 'nulo', 1, 1, 'po', 19),
(52, 'why Sonaray', 'DT1 Rep Crom ', '<p>O índice de renderização de cor (CRI) é uma medida quantitativa da capacidade de uma fonte luminosa de reproduzir com precisão as cores de vários objetos em comaparação com uma fonte luminosa natural. A DASCOM usa LEDs com o maior índice de renderização de cor produzindo cores genuínas com valores de CRI entre 80 e 95%. É relevante comparar com os produtos LEDs de mercado, inclusive das marcas mais conhecidas, que em geral alcançam índices CRI em torno de 70%. O efeito resultante é que usar produtos de iluminação LED DASCOM produz mais claridade, cores mais aparentes e maior atração visual natural, seja consciente ou inconscientemente.<br />\n         </p>', 'nulo', 1, 1, 'po', 20),
(53, 'why Sonaray', 'DT2 Ran Crom', 'Campo de Cromaticidade', 'nulo', 1, 2, 'po', 18),
(54, 'why Sonaray', 'DT2 H2 Ran Crm', 'Campo de Cromaticidade Elipse de 3 passos de MacAdam', 'nulo', 1, 2, 'po', 19),
(55, 'why Sonaray', 'DT2 Text Ran Cro ', ' <p>O padrão ANSI C78.377 é um padrão oficial do American National Standards Institute. O Campo de Cromaticidade dos produtos Sonaray atende o padrão ANSI C7.377 e alguns produtos correspondem à chamada "Elipse ou Diagrama de MacAdam de 3 passos)". Trata-se de campos de cromaticidade reduzidos a aproximadamente um nono do padrão acima. </p>', 'nulo', 1, 2, 'po', 20),
(56, 'why Sonaray', 'why Sonaray', 'Padrão IESNA LM-80', 'nulo', 1, 3, 'po', 18),
(57, 'why Sonaray', 'DT3 H2 Estandar', 'Padrão IESNA LM-80', 'nulo', 1, 3, 'po', 19),
(58, 'why Sonaray', 'DT3  Texto 1 ', '<p>Com uma reputação inigualável em produtos de alta qualidade, a DASCOM se diferencia dos muitos outros no mercado LED porque assegura que todos os chipsets usados nos produtos de iluminação LED atendem o padrão IES LM-80, um padrão de qualidade oficial IESNA - Illuminating  Engineering Society of North America.  O padrão LM-80 é um teste comumente usado para medir a manutenção de lúmen emitido por fontes de luz LED - através do uso durante 6.000 horas divididos em intervalos maiores que 1.000 horas, submetidos a diferentes temperaturas na área chamada junção do led - é possíel projetar a manutenção de emissão de lúmen depois de 35.000 horas de uso.</p>\r\n<br/>\r\n<p>A manutenção  de lúmen é uma medida que estabelece qual percentual de emissão de lúmen a fonte luminosa consegue manter ao longo do tempo, em relação ao nível de emissão inicial. Tipicamente a manutenção de lúmen em LEDs é acima de 70%  após 35.000 horas ou mais - uma avanço significativo sobre as fontes luminosas tradicionais. </p>', 'nulo', 1, 3, 'po', 20),
(60, 'why Sonaray', 'DT4  Norma seg ', 'Padrão de Biosegurança', 'nulo', 1, 4, 'po', 18),
(61, 'why Sonaray', 'DT4  H2 Seguridad ', 'Padrão EN62471:2008 - Padrão de Biosegurança de Produtos de Iluminação', 'nulo', 1, 4, 'po', 19),
(62, 'why Sonaray', 'DT4 Texto seg ', '<p>Fontes de iluminação emitem certos níveis de calor e radiação que podem ser prejudiciais à pele e aos olhos humanos. Padrões oficiais tem sido criados para classificar os níveis de segurança e graduar diferentes fontes de iluminação. A DASCOM usa as melhores fontes de iluminação LED, os quais são classificados como Nível 4 - o mais alto padrão de segurança para fontes de luz, o que os certificam como não prejudiciais aos humanos. <br />\n        </p>', 'nulo', 1, 4, 'po', 20),
(63, 'why Sonaray', 'DT1 Rep Crom', '显色指数', 'nulo', 1, 1, 'ch', 18),
(64, 'why Sonaray', 'DT1 Rep Crom H2', '显色指数（CRI) Ra80', 'nulo', 1, 1, 'ch', 19),
(65, 'why Sonaray', 'DT1 Rep Crom', '<p>显色指数（CRI，有时也被称为色彩再现指数），是一种用理想或自然的光源来比较，真实地再现各种物体颜色的光源测量指数。得实采用的LED芯片具有最高水平的顶级显色性，其显色指数介乎80至95%。 这优于市场上的大多数LED产品,包括知名品牌的LED芯片和LED照明产品的显色性一般只达到70%左右。由此产生的效应当在使用得实LED照明时你有更清晰的体验,无论是意识和潜意识上都感受更好的外观颜色和自然的视觉吸引。<br /></p>', 'nulo', 1, 1, 'ch', 20),
(66, 'why Sonaray', 'DT1 Rep Crom', '色度范围', 'nulo', 1, 2, 'ch', 18),
(67, 'why Sonaray', 'DT2 H2 Ran Crm', '“ 三步迈克亚当椭圆”色度范围', 'nulo', 1, 2, 'ch', 19),
(68, 'why Sonaray', 'DT2 Text Ran Cro', '<p>ANSI C78.377 是由美国国家标准协会制定的色度范围标准。实诺锐照明产品色度范围不但符合ANSIC78.377 ，部分产品甚至符合更严格的“ 三步迈克亚当椭圆”色度范围缩小至有关上述标准的九份之一。  \n        </p>', 'nulo', 1, 2, 'ch', 20),
(69, 'why Sonaray', 'DT3 Estandar', 'LM-80测量标准', 'nulo', 1, 3, 'ch', 18),
(70, 'why Sonaray', 'DT3 H2 Estandar', 'LM-80测量标准', 'nulo', 1, 3, 'ch', 19),
(71, 'why Sonaray', 'DT3 Texto1', '<p>拥在产品质量上有一个无与伦比的声誉,得实区分自己从许多在LED市场通过确保所有用于得实照明产品的LED芯片符合IES lm - 80标准,一个北美照明工程协会(IESNA)正式的质量标准。 LM-80是一种常见的光学测量准则,通过对产品约6000小时的持续测试分解成不少于1000小时，在不同的结点温度，推算出产品在35000小时后的光通量效能。  </p><br/>\r\n<p>流明维持是一个衡量一个光源如何保持它的流明输出,通常显示为初始光输出的一个百分比。一般情况下LED在运作35000小时以上后依然维持原有光通量70%以上——相比传统光源的一个显著改进。 </p>', 'nulo', 1, 3, 'ch', 20),
(73, 'why Sonaray', 'DT4 Norma seg', '安全标准', 'nulo', 1, 4, 'ch', 18),
(74, 'why Sonaray', 'dt4 tITULO', '光生物安全标准 EN62471:2008', 'nulo', 1, 4, 'ch', 19),
(75, 'why Sonaray', 'Dt4 texto', '<p>光源释放的热量和辐射有害人体皮肤和眼睛。官方标准已经建立分类安全水平和不同的光源。得实使用最优质的LED光源,它被分为第4级最高安全标准,以确保他们的光源安全，对人类无害。\n  <br />\n        </p>', 'nulo', 1, 4, 'ch', 20),
(76, '', '', '', NULL, 0, NULL, '', 0),
(77, 'caseStudies', 'caseStudies', '<table border="0" cellpadding="0" cellspacing="0" style="height:129px; width:1370px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The seventh busiest international airport today, Changi Airport is a major air hub in Asia. It handled more than 51 million passenger movements in 2012 and registered a monthly record of 4.92 million in December 2012.</span></p>\r\n			</td>\r\n			<td><span style="font-size:14px">imagen</span></td>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">Presently, Changi Airport serves some 110 airlines flying to over 240 cities in about 60countries and territories worldwide. A flight takes off or lands at Changi Airport roughly once every 100 seconds. With over 70,000square metres of commercial space across its four terminals, Changi Airport is also one of Singapore&rsquo;s best places for shopping and dining. Increasingly, the airport has become a favourite haunt for Singapore residents, especially families.</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '/caseStudies', 1, 0, 'en', 0),
(90, 'caseStudies', 'caseStudies', '<table align="center" border="0" cellpadding="0" cellspacing="0" style="height:272px; width:1357px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">Chanel is a world famous luxury brand. Product categories range from clothing, jewelry, cosmetics, perfume and so on. Sonaray installed the LED lamps for the Chanel cosmetics, skin care products and perfume Shoppes, currently there are totally 14 region stores have been installed include mainland China (1), (2) in Hong Kong, Taiwan (10), Thailand (1), the lighting retrofit project is continuing.</span></p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n			</td>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">imagen</span></p>\r\n			</td>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">Chanel high-end brand image No deviation ?Color Temperature : The CCT exactly same as original lamp; The CCT comply with 3-Step MacAdam Eclipses Test , there is no chromatic aberration discerned by visible to the naked eye.</span></p>\r\n\r\n			<p style="text-align:justify"><br />\r\n			<span style="font-size:14px">High CRI (CRI&gt;80): Restore products? actual color Excellent Light effect:No light spots from front side</span></p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n', NULL, 1, 0, 'en', 0),
(91, 'caseStudies', 'caseStudies', '<table align="center" border="1" bordercolor="#ccc" cellpadding="5" cellspacing="0" style="border-collapse:collapse">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The second people&#39;s hospital of Guangzhou Liwan district is a 20 years of history set of medical, scientific research, teaching&nbsp; in one of the general hospital.</span></p>\r\n\r\n			<p style="text-align:justify"><span style="font-size:14px">There is about 10000 square&nbsp;&nbsp; meters on floor area.The Sonaray lighting retrofit area is a&nbsp; four layer of outpatient service building,This building mainly use old- fashion light panel with T8 and T5 fluorescent tube.</span></p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n			</td>\r\n			<td><span style="font-size:14px">imagen</span></td>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The whole lamps replacement make the lighting facilities look brand- new, lighting effect is improved outstandingly.</span></p>\r\n\r\n			<p style="text-align:justify"><span style="font-size:14px">Improve illumination and Low lumens depreciation. The original lamps had serious depreciation,Before retrofit,most of lamps have attenuate to 60-70lux;After replaced by Sonaray tubes the illumination have improved up to 80-90lux.</span></p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n\r\n			<p style="text-align:justify">&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', NULL, 1, 0, 'en', 0),
(92, 'caseStudies', 'caseStudies', '<table align="center" border="0" cellpadding="0" cellspacing="0" style="height:222px; width:1305px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The Central University of Venezuela is one of the top universities in Venezuela with international projection. Today, it maintains a student enrollment of around 54,222 undergraduates and 8,317 postgraduate students with 8,601 professors distributed in Caracas in 9 Faculties, 2 Faculties in Maracay.</span></p>\r\n			</td>\r\n			<td><span style="font-size:14px">IMAGEN</span></td>\r\n			<td>\r\n			<ul>\r\n				<li style="text-align:justify"><span style="font-size:14px">Reduction of 40% of power consumption in common areas.</span></li>\r\n				<li>\r\n				<p style="text-align:justify"><span style="font-size:14px">Increase of average illuminance level up to 92% in a classroom, obtaining more comfortable lighting and an even light distribution</span></p>\r\n				</li>\r\n				<li>\r\n				<p style="text-align:justify"><span style="font-size:14px">Increased PF up to 0.98, and reduced THD almost 50%</span></p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 1, 0, 'en', 0),
(93, 'caseStudies', 'caseStudies', '<table align="center" border="0" cellpadding="0" cellspacing="0" style="height:126px; width:1336px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">Factory HKA C.A. is an international company representative of the best brands of tax equipment with offices in Miami, Venezuela and Panama. The headquarter located in Venezuela takes place the assemble, tests and distribution of its products.</span></p>\r\n			</td>\r\n			<td><span style="font-size:14px">IMAGEM</span></td>\r\n			<td style="text-align:justify">\r\n			<ul>\r\n				<li>\r\n				<p><span style="font-size:14px">Higher illuminance level and lower energy cost, reducing 55% of electrical consumption compared with the existing lighting.</span></p>\r\n				</li>\r\n				<li>\r\n				<p><span style="font-size:14px">Increase of illuminance level up to 161% in working areas.</span></p>\r\n				</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 1, 0, 'en', 0),
(94, 'caseStudies', 'caseStudies', '<table align="center" border="0" cellpadding="0" cellspacing="0" style="height:155px; width:1310px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The As early as 1995, China Merchants Logistics Holdings Co. Ltd. grew out of Shenzhen Anda Transportation Co., Ltd., which was the first company in introducing to China third party logistics and advanced logistics technology and started the shift from traditional warehousing to modern logistics. Now its logistics sector has gradually built up its national network, with 70 logistics distribution centers located in major cities of China.</span></p>\r\n			</td>\r\n			<td><span style="font-size:14px">imagen</span></td>\r\n			<td style="text-align:justify">\r\n			<p><span style="font-size:14px">Higher illuminance level and 51% of energy and electrical bill savings compared to the existing lightings; 35,000 hours lumens maintenance to 70% of the initial luminous flux, which reducing replacement of spare bulb and lowering of maintenance.</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, 1, 0, 'en', 0),
