(215, 'aboutUs', 'About Us 1', '<p>Die DASCOM Europe GmbH mit Sitz in Ulm ist die europ&auml;ische Zentrale, von der aus seit Mai 2009 alle europ&auml;ischen Aktivit&auml;ten gesteuert werden.</p><p>Wir vertreiben die komplette Produktreihe an Nadel-, Flachbett-, Mobil- und Thermodrucker unter den Markennamen Tally und Tally Dascom f&uuml;r kommerzielle und industrielle Anwendungen. Unsere Drucker sind speziell f&uuml;r die Anforderungen aus den Bereichen Transport, Logistik, Produktion, Handel, Gesundheitswesen und Banken entwickelt. K&uuml;nftig engagieren wir uns auf dem innovativen Markt der LED-Technologie mit Lichtl&ouml;sungen f&uuml;r Unternehmen im &Ouml;ffentlichen-, B&uuml;ro- und Industriebereich. Die Marke SONARAY umfasst die komplette Linie von LED-Beleuchtungsl&ouml;sungen, die un&uuml;bertroffene Qualit&auml;t und Klarheit des Lichts und Energieeinsparungen f&uuml;r unsere Kunden bringt.</p><p>Mit der Marke Sonaray m&ouml;chte Dascom sich mit innovative und professionelle Lichtl&ouml;sungen f&uuml;r Unternehmen im &Ouml;ffentlichen-, Office- und Industriebereich etablieren.</p>', 'null', 1, 0, 'du', 17),
(216, 'aboutUs', 'About us 2', '<p>Mit unseren umfangreichen Entwicklungs-, Test-, und Fertigungskapazit&auml;ten produzieren wir qualitativ hochwertige LED Beleuchtung. Unsere Investitionen in diese Technologie bedeutet f&uuml;r unsere Kunden Kostenersparnis und eine reduzierung des CO&sup2; Footprins. Au&szlig;erdem erzeugen LEDs keine UV undInfrarotstrahlung. Durch die fehlende UV-Strahlung werden Kunststoffe und Farben nicht ausgebleicht oder verspr&ouml;det. Gleichzeitig werden keine Insekten angezogen, so dass keine Verschmutzung stattfindet.</p>', 'null', 1, 0, 'du', 17),
(217, 'aboutUs', 'About Us 3', '<p>Weitere Informationen erhalten Sie bei unserer Marketingabteilung.</p><p>DASCOM Europe GmbH<br />Heuweg 3<br />89079 Ulm<br /><br />Telefon: +49 (0) 731 - 20 75 - 0<br />Telefax: +49 (0) 731 - 20 75 - 100<br />email: <a href="mailto:info.de@dascom.com">info.de@dascom.com</a></p>', 'null', 1, 0, 'du', 17),
