(220, 'why Sonaray', 'DT1 Rep Crom', '<p>Der Color Rendering Index (CRI) bzw. Farbwiedergabeindex (Ra) gibt an, wie die Farbtreue sich durch die Beleuchtung &auml;ndert bzw. wie naturgetreu da Lampenlicht eine Farbe wiedergeben kann. Die Farbtreue l&auml;sst sich anhand einer Referenz-Farbkarte &uuml;berpr&uuml;fen.</p>', 'nulo', 1, 1, 'du', 20),
(221, 'why Sonaray', 'DT1 Rep Crom', 'Chromaticity&nbsp; Range', 'nulo', 1, 2, 'du', 18),
(222, 'why Sonaray', 'DT2 H2 Ran Crm', 'Chromaticity Range 3 Stufige McAdam-Ellipse', 'nulo', 1, 2, 'du', 19),
(223, 'why Sonaray', 'DT2 Text Ran Cro', '<p>Ansi C78.377 ist ein offizieller Standard f&uuml;r die Farbraum Charakterisierung erstellt vom der American National Standards Institute. Das Sonaray Produktportfolio erf&uuml;llt den ANSI C78.377 Standard, einige Produkte sind nach der 3 Stufigen McAdam-Ellipse eingestuft welche neun Mal bessere, weil engere Farbr&auml;ume definiert.</p>', 'nulo', 1, 2, 'du', 20),
(224, 'why Sonaray', 'DT3 Estandar', 'IESNA&nbsp; LM-80&nbsp; Standard', 'nulo', 1, 3, 'du', 18),
(225, 'why Sonaray', 'DT3 H2 Estandar', 'IESNA&nbsp; LM-80&nbsp; Standard', 'nulo', 1, 3, 'du', 19),
(226, 'why Sonaray', 'DT3 Texto1', '<p>Der IES LM-80 Standard der IESNA Illuminating Engineering Society of North America ist ein verbreiteter Test zur Ermittlung der Lebensdauer einer LED. Hierbei wird ein Dauertest &uuml;ber 6000 Stunden mit verschieden Ansteuerstr&ouml;men durchgef&uuml;hrt um eine Hochrechnung des Lichtstromabfalls &uuml;ber eine Nutzungsdauer von 35.000 Stunden zu erstellen.</p><p>&nbsp;</p><p>Lumen Maintenance ist der Wert f&uuml;r die erhalt einer Lichtleistung &uuml;ber einen Zeitraum typischer weise wird dieser in Prozent der &uuml;rspr&uuml;nglichen Lichtleistung angegeben. Ein typischer Wert f&uuml;r die Lumen Maintenance ist &uuml;ber 70% f&uuml;r 35.000 Stunden</p><p>&nbsp;</p>', 'nulo', 1, 3, 'du', 20),
(227, 'why Sonaray', 'DT4 Norma seg', 'Sicherheitsstandarts', 'nulo', 1, 4, 'du', 18),
(228, 'why Sonaray', 'dt4 tITULO', 'Photobiologische Sicherheit nach EN 62471', 'nulo', 1, 4, 'du', 19),
(229, 'why Sonaray', 'Dt4 texto', '<p>Manche Lichtquellen k&ouml;nnen Strahlung z.B. im Ultravioletten Bereich emittieren welche sch&auml;dlich f&uuml;r die Menschliche Haut oder die Augen sind. Deshalb wurden Internationale Normen f&uuml;r die photobiologische Sicherheit von Lampen und Lampensystemen geschaffen. Dascom verwendet hochwertigste LED Chips welche den h&ouml;chsten Sicherheitsstandards entsprechen und unsch&auml;dlich f&uuml;r Menschen eingestuft sind.</p>', 'nulo', 1, 4, 'du', 20),
(230, 'caseStudies', 'caseStudies', '<table border="0" cellpadding="0" cellspacing="0" style="height:129px; width:1370px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">The seventh busiest international airport today, Changi Airport is a major air hub in Asia. It handled more than 51 million passenger movements in 2012 and registered a monthly record of 4.92 million in December 2012.</span></p>\r\n			</td>\r\n			<td><span style="font-size:14px">imagen</span></td>\r\n			<td>\r\n			<p style="text-align:justify"><span style="font-size:14px">Presently, Changi Airport serves some 110 airlines flying to over 240 cities in about 60countries and territories worldwide. A flight takes off or lands at Changi Airport roughly once every 100 seconds. With over 70,000square metres of commercial space across its four terminals, Changi Airport is also one of Singapore&rsquo;s best places for shopping and dining. Increasingly, the airport has become a favourite haunt for Singapore residents, especially families.</span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '/caseStudies', 1, 0, 'du', 0);
