(250, 'logistic', 'DT1 Rep Crom', '<p>LOGISTIC Energy resources</p>', 'nulo', 1, 1, 'en', 27),
(251, 'logistic', 'DT1 Rep Crom H2', 'Energy resources (CRI)  Ra80 ', 'nulo', 1, 1, 'en', 28),
(252, 'logistic', 'DT1 Rep Crom', '<p>The color rendering index (CRI) (sometimes called <em>color rendition index</em>,) is a quantitative measure of the ability of a light source to reproduce the colors of various objects precisely in comparison with an ideal or natural light source.  DASCOM uses LEDs with the highest level of top color rendering, yielding a genuine color range between 80 and 95% of CRI.  This compares favorably with most LED products on the market, including well-known brands, that generally achieve only a CRI rating of around 70%.  The resulting effect when using DASCOM LED lighting is that you will experience more clarity, better color appearance and natural visual appeal, both consciously and subconsciously.<br />\n         </p>', 'nulo', 1, 1, 'en', 29),
(253, 'logistic', 'DT1 Rep Crom', 'Information systems', 'nulo', 1, 2, 'en', 27),
(254, 'logistic', 'DT2 H2 Ran Crm', 'Information systems 3-Step MacAdam Ellipse', 'nulo', 1, 2, 'en', 28),
(255, 'logistic', 'DT2 Text Ran Cro', '<p>ANSI C78.377 is an official standard for chromaticity specified by American National Standards Institute. Sonaray products'' range complies with ANSI C78.377 and some products correspond to “3-steps MacAdam ellipses,” which are the information systemss narrowed to about a ninth of that of the standard above.  \n        </p>', 'nulo', 1, 2, 'en', 29),
(256, 'logistic', 'DT3 Estandar', '', 'nulo', 1, 3, 'en', 27),
(257, 'logistic', 'DT3 H2 Estandar', 'Outsourced services', 'nulo', 1, 3, 'en', 28),
(258, 'logistic', 'DT3 Texto1', '<p>With an unmatched reputation for product quality, DASCOM differentiates itself from many of those in the LED market by making sure that all of the LED chipsets used on DASCOM lighting products comply with the IES LM-80 standard, an official quality standard from the Illuminating Engineering Society of North America (IESNA). The LM-80 is a common test to measure the lumen maintenance of LED light sources - through a usage of 6,000 hours broken down into intervals of not less than 1,000 hours, at different junction temperatures - to give the projection of lumen maintenance after usage of 35,000 hours.  </p><br/>\r\n<p>Lumen maintenance is a measure of how well a light source maintains its lumen output over time, typically shown as a percentage of initial light output. Typical LED lumen maintenance is over 70% for 35,000+ hours – a marked improvement over traditional light sources. </p>', 'nulo', 1, 3, 'en', 29),
(259, 'logistic', 'DT4 Norma seg', 'The logistic function', 'nulo', 1, 4, 'en', 27),
(260, 'logistic', 'dt4 tITULO', 'Example', 'nulo', 1, 4, 'en', 28),
(261, 'logistic', 'Dt4 texto', '<p>EXAMPLE Light sources emit certain levels of heat and radiation that can be harmful to human skin and eyes. Official standards have been made to classify the safety levels and grading of different light sources. DASCOM uses the best quality LED light sources, which are classified as Grade 4 - the highest The logistic function for lighting sources, which certifies them as safe and not harmful to humans.</p>', 'nulo', 1, 4, 'en', 29),
