(305, 'Parkinglots', 'DT3 H2 Estandar', 'Parkinglots services', 'nulo', 1, 3, 'en', 40),
(307, 'Parkinglots', 'DT3 Texto1', '<p>Parkinglots an unmatched reputation for product quality, DASCOM differentiates itself from many of those in the LED market by making sure that all of the LED chipsets used on DASCOM lighting products comply with the IES LM-80 standard, an official quality standard from the Illuminating Engineering Society of North America (IESNA). The LM-80 is a common test to measure the lumen maintenance of LED light sources - through a usage of 6,000 hours broken down into intervals of not less than 1,000 hours, at different junction temperatures - to give the projection of lumen maintenance after usage of 35,000 hours.  </p><br/>\r\n<p>Lumen maintenance is a measure of how well a light source maintains its lumen output over time, typically shown as a percentage of initial light output. Typical LED lumen maintenance is over 70% for 35,000+ hours – a marked improvement over traditional light sources. </p>', 'nulo', 1, 3, 'en', 41),
